    static class ArrayEqulibrium
    {
        public static int solution(int[] A)
        {
            int arrayLength = -1;
            long sum = 0;
            long leftSum = 0;
            long RightSum = 0;
            List<int> EqulibriumIndicies = new List<int>();

            arrayLength = A.Length;

            if (arrayLength == -1)
                return -1;
            for (int i = 0; i < arrayLength; i++)
                sum += A[i];

            for (int i = 0; i < arrayLength; i++)
            {
                RightSum = sum - leftSum - A[i];

                if (RightSum == leftSum)
                    EqulibriumIndicies.Add(i);

                leftSum += A[i];
            }

            Random rnd = new Random();

            if (EqulibriumIndicies.Count > 0)
            {
                int r = rnd.Next(EqulibriumIndicies.Count);
                return EqulibriumIndicies[r];
            }
            else
                return -1;
        }

    }


